import styled from "styled-components";

export const MainImage = styled.div`
  width: 100%;
  padding: 0 0 60%;
  position: relative;

  div {
    position: absolute;
    left: 0;
    top: 0;
    width: 100%;
    height: 100%;
    background-size: contain;
    background-position: center;
  }
`;
